import { data } from "./data";
class House extends React.Component{
constructor(){
    super()
    this.state={
    cloud:data
}
}
render(){
    return(
   cloud.map=(value)=>{
    <div className="wrapper">
        <div><img src={value.photo}></img></div>
          <div>
            <p>{value.name}</p>
            <p>{value.place}</p>  
          </div>
        <div>

        </div>


    </div>

   }
    )
}
}
export {House}
